import React from "react";
import { SET_ACTIVE_WELL } from './types'

export const setActiveWell = (well) => dispatch => {
  // console.log(`well logged in setActiveWell actionCreator: ${well}`)

  dispatch({type: SET_ACTIVE_WELL, payload: well})
}
